INSERT INTO `productos` (`idProductos`, `Titulo`, `Descripcion`, `Precio`, `Cantidad_stock`, `Imagen`, `Categorias_Productos_idCategorias_productos`) VALUES
(15, 'Auricular Vincha Noga - Negro\r\n', 'En la calle, en el colectivo o en la oficina, tené siempre a mano tus auriculares Noga y ¡escapate de la rutina por un rato! Vas a poder disfrutar de la música que más te gusta y de tus podcasts favoritos cuando quieras y donde quieras.<br><br>\r\n<b>ESPECIFICACIONES:</b>\r\n<br>\r\n- Sonido Hi-Fi\r\n<br>\r\n- Bajos Reforzados\r\n<br>\r\n- Control de Volumen\r\n<br>\r\n- Conexión: miniplug 3.5 Stereo\r\n<br>\r\n- Longitud del Cable: 1,2 metros\r\n<br>\r\n- Vincha Ajustable\r\n<br>\r\n- Acolchados con material sintético', '1200', 3, , 5);
INSERT INTO `productos` (`idProductos`, `Titulo`, `Descripcion`, `Precio`, `Cantidad_stock`, `Imagen`, `Categorias_Productos_idCategorias_productos`) VALUES
(69, 'Inpods 12 - Celeste', 'Los i12 Tws ofrecen una estabilidad de señal más avanzada que en modelos anteriores. Posee controles multifunción por Touch. Poné Play, Pausa con un toque, cambio de Canciones con tres toques en el auricular izquierdo o retroceder con los mismos toques en el derecho. ¡Genial!<br><br>\r\n<b>ESPECIFICACIONES</b>\r\n<br>\r\n- Tactil\r\n<br>\r\n- Potencia de salida: 2.4G-3.2GHZ\r\n<br>\r\n- Capacidad de la batería 35 mAh\r\n<br>\r\n- Versión Bluetooth: Bluetooth 5,0\r\n<br>\r\n- Distancia Bluetooth: 15 metros\r\n<br>\r\n- Tipo de conexión: inalámbrica con micrófono manos libre\r\n<br>\r\n- iOS Actualizado\r\n<br>\r\n- Dimensiones: 158.2 x 77.9 x 7.3 mm\r\n<br>\r\n- Peso: 188g\r\n<br><br>\r\n\r\nCONTENIDO DE CAJA\r\n<br>\r\n-Estuche\r\n<br>\r\n-Audifonos\r\n<br>\r\n-USB de carga\r\n<br>\r\n-Manual de uso.', '5500', 4, , 5);
INSERT INTO `productos` (`idProductos`, `Titulo`, `Descripcion`, `Precio`, `Cantidad_stock`, `Imagen`, `Categorias_Productos_idCategorias_productos`) VALUES
(75, 'IPhone 7 plus', 'Hace con iPhone todo lo que desees e imagines posible, su velocidad y eficiencia, nunca se veran afectadas.<br>\r\nRealiza llamadas con la mayor calidad de audio y eliminacion de ruidos ambientales.<br>\r\nLleva tu musica a otro nivel, su parlante stereo no tiene rival en sonido ambiente ni con sus auriculares.<br>\r\nSaca fotos y selfies increibles instantaneamente compartilas en tus redes, tus dispositivos o chats, imprimilas o envialas por correo, y mas!<br><br>\r\n<b>ESPECIFICACIONES</b>\r\n<br>\r\n- Pantalla 5.5 - 1080 x 1920 pixels\r\n<br>\r\n- Procesador Apple A10 64 Bits\r\n<br>\r\n- RAM: 3GB\r\n<br>\r\n- Capacidad: 128 GB\r\n<br>\r\n- Cámara 12 MP\r\n<br>\r\n- Batería 2900 mAh\r\n<br>\r\n- iOS Actualizado\r\n<br>\r\n- Dimensiones: 158.2 x 77.9 x 7.3 mm\r\n<br>\r\n- Peso: 188g', '60000', 2, , 1);
